  const [data, setData] = useState();
  var user = auth.currentUser;
  const test = () => {
    if (user) {
      console.log("all user data", user);
      console.log("uid user", user.uid);
    } else {
      console.log("error");
    }
  };

  return (
    <div>
      <Navbar />
      <h1>หน้าหลัก</h1>
      {/* <a onClick={submit}>enter</a> */}
      <button onClick={test}>test user data</button>
    </div>
  );
};

export default Home;
